;------------------------------------------------------------------------------
; PROJECT: VIA TEST
; VERSION: 0.0.1
;    FILE: VIA_TEST.ASM
;  AUTHOR: CRAIG IANNELLO, PUGBUTT.COM
;
; DESCRIPTION: 
;   EXPERIMENTS WITH 65C22S VIA AND CONNECTED ATMEGA328PB
;
;------------------------------------------------------------------------------
    INCLUDE DEFINES.D           ; COMMON DEFINITIONS
    INCLUDE BIOS_FUNC_TAB.D     ; BIOS FCN JUMP TABLE AND CONSTANTS
;------------------------------------------------------------------------------
    ORG       $1000             ; BEGIN CODE & VARS
; -----------------------------------------------------------------------------
; PROGRAM ENTRYPOINT
; -----------------------------------------------------------------------------
ENTRYPOINT
    LDA  #TEXT_RESET  ; set 80x30 mode
    STA  PICO_R0
    LDA  #0
    STA  PICO_R1
    LDA  #30
    STA  CUR_ROWS
    LDA  #TEXT_COLOR_SET
    STA  PICO_R0
    LDA  #%00010000 ; dark red
    STA  PICO_R1
    LDA  #%00111000 ; amber
    STA  PICO_R1    
    JMP  INIT
;------------------------------------------------------------------------------
; VARS
;------------------------------------------------------------------------------
MYBUF       RMB  64     ; STRING BUF
; USED IN TS_TO_DATE
TMP64       RMB  8
TMP16_0     RMB  2
TMP16_1     RMB  2
TMP8_0      RMB  1
TMP8_1      RMB  1
CUR_TEXTMODE RMB 1  ; 0: 80x30, 1: 80x60, 2: 80x120
CUR_ROWS    RMB  1  ; 30, 60, 120
;------------------------------------------------------------------------------
; Output string at X to PICO VGA followed by a Linefeed and Carriage return.
; Control characters are treated as normal font glyphs. (Codepage 437)
;------------------------------------------------------------------------------
PUTS
    LDA  #TEXT_PRINTC        ; char entry mode
    STA  PICO_R0
PUTS_LOOP
    LDA ,X+
    BEQ PUTS_END
    STA PICO_R1
    JMP PUTS_LOOP
PUTS_END
    ;LDA  #5
    ;STA  PICO_R1
    RTS
;------------------------------------------------------------------------------
; Do a busyloop for duration specified by a u16 value in Y. 
;------------------------------------------------------------------------------
DELAY    
    PSHS B
ODLOOP
    LDB  #120
DLOOP
    DECB
    BNE  DLOOP
    LEAY -1,Y
    BNE  ODLOOP
    PULS B
    RTS
;------------------------------------------------------------------------------
CLEARHOME:
    LDA  #TEXT_CLEAR        ; clear screen
    STA  PICO_R0
    LDA  #TEXT_HOME        ; cursor home
    STA  PICO_R0
    RTS
;------------------------------------------------------------------------------
PRINTPARA:
    ; print a bunch of null-terminated strings with linefeeds between
    LDX  #MSG
MSGLOOP
    JSR  PUTS
    LDA  #10         ; CR/LF
    STA  PICO_R1
    CMPX #ENDMSG
    BNE  MSGLOOP
    RTS
;------------------------------------------------------------------------------
PARA2:
    ; print a bunch of null-terminated strings with spaces between
    LDX  #MSG3
MSGLOOP3
    JSR  PUTS
    LDA  #32         ; space
    STA  PICO_R1
    CMPX #ENDMSG3
    BNE  MSGLOOP3
    RTS    
;------------------------------------------------------------------------------
PRINTWORD:
    ; print a bunch of null-terminated strings
    LDX  #MSG_WORD
MSGLOOP2
    JSR  PUTS
    CMPX #ENDMSG_WORD
    BNE  MSGLOOP2
    RTS
;------------------------------------------------------------------------------
; Selects text font and clears screen. 
;
; Param:    font index (see defines.d)
;
SET_TEXTMODE:
    CMPA #FONT_8X16_VGA
    LBNE NOT_VGA
    STA  CUR_TEXTMODE   ; Mode 0: 16x8 VGA Text
    LDA  #30            ; 30 rows/screen
    BRA  T_SET_MODE
NOT_VGA
    CMPA #FONT_8X16_SEMIGRAPHICS
    LBNE NOT_VSEMI
    STA  CUR_TEXTMODE   ; Mode 1: 16x8 Text + Semigraphics
    LDA  #30            ; 30 rows
    BRA  T_SET_MODE
NOT_VSEMI
    CMPA #FONT_8X8_CGA
    LBNE NOT_CGA
    STA  CUR_TEXTMODE   ; Mode 16: 8x8 CGA Text
    LDA  #60            ; 60 rows
    BRA  T_SET_MODE
NOT_CGA
    CMPA #FONT_8X8_SEMIGRAPHICS
    LBNE NOT_CSEMI
    STA  CUR_TEXTMODE   ; Mode 17: 8x8 Text + Semigraphics
    LDA  #60            ; 60 rows
    BRA  T_SET_MODE
NOT_CSEMI
    CMPA #FONT_8X4_SEMIGRAPHICS
    LBNE NOT_MODE32
    STA  CUR_TEXTMODE   ; Mode 32: 8x4 Semigraphics
    LDA  #120           ; 120 rows/screen
    BRA  T_SET_MODE
NOT_MODE32:
    CMPA #FONT_8X1_SEMIGRAPHICS
    LBNE NOT_MODE64
    STA  CUR_TEXTMODE   ; Mode 64: 8x1 Semigraphics
    LDA  #240           ; actually 480 rows/screen! need to realloc this var
    BRA  T_SET_MODE
NOT_MODE64:    
    RTS
T_SET_MODE:
    STA  CUR_ROWS       ; Remember screen height in rows
    LDA  #TEXT_RESET    ; PugVDP select font
    STA  PICO_R0
    LDA  CUR_TEXTMODE
    STA  PICO_R1
    RTS
;------------------------------------------------------------------------------
; Displays glyph art at address X
;
SHOW_GLYPHART:
    LDA  CUR_ROWS   ; A = Screen Rows
    LDB  #80        ; B = Screen Cols = 80 
    MUL             ; D = Rows * Cols
    TFR  D,Y        ; Let Y = D
GLYPHLOOP
    LDA  #TEXT_COLOR_SET
    STA  PICO_R0    
    LDA  ,X+
    STA  PICO_R1
    LDA  ,X+
    STA  PICO_R1
    LDA  #TEXT_PUTC
    STA  PICO_R0
    LDA  ,X+
    STA  PICO_R1
    LEAY -1,Y
    LBNE GLYPHLOOP
    RTS   
;------------------------------------------------------------------------------
; TEST
;------------------------------------------------------------------------------
INIT:
    LBSR CLEARHOME
    LBSR PRINTPARA
TESTLOOP    
    JSR   BF_UT_GETC ; Quit if escape pressed
    CMPA  #$1B
    LBEQ  ENDLOOP

    CMPA  #'i'       ; scroll up
    BNE  NOSU
    LDA  #TEXT_SCROLL_V
    STA  PICO_R0
    LDA  #1
    STA  PICO_R1
    LBRA ENDS
NOSU    
    CMPA  #'j'       ; scroll left
    BNE  NOSL
    LDA  #TEXT_SCROLL_H
    STA  PICO_R0
    LDA  #1
    STA  PICO_R1
    LBRA  ENDS
NOSL    
    CMPA  #'k'       ; scroll right
    BNE  NOSR
    LDA  #TEXT_SCROLL_H
    STA  PICO_R0
    LDA  #-1
    STA  PICO_R1
    LBRA  ENDS
NOSR    
    CMPA  #'m'       ; scroll down
    BNE  NOSD
    LDA  #TEXT_SCROLL_V
    STA  PICO_R0
    LDA  #-1
    STA  PICO_R1
NOSD
    CMPA  #'r'       ; redraw
    BNE  NOR
    JMP  INIT 
NOR
    CMPA  #'c'       ; clear
    BNE  NOC
    JSR  CLEARHOME
    LBRA ENDS    
NOC
    CMPA  #'1'       ; green font
    BNE  NOCU
    LDA  #TEXT_COLOR_SET
    STA  PICO_R0
    LDA  #%00000100 ; dark green bg
    STA  PICO_R1
    LDA  #%00001100 ; green fg
    STA  PICO_R1
    LBSR PARA2
    LBRA  ENDS
NOCU    
    CMPA  #'2'       ; blue font
    BNE  NOCL
    LDA  #TEXT_COLOR_SET
    STA  PICO_R0
    LDA  #%00000001 ; dark blue bgq
    STA  PICO_R1
    LDA  #%00000011 ; blue fg
    STA  PICO_R1
    LBSR PARA2
    LBRA  ENDS
NOCL
    CMPA  #'3'       ; white font
    BNE  NOCD
    LDA  #TEXT_COLOR_SET
    STA  PICO_R0
    LDA  #%00010101 ; dark gray bg
    STA  PICO_R1
    LDA  #%00111111 ; white fg
    STA  PICO_R1
    LBSR PARA2
    LBRA  ENDS
NOCD
    CMPA  #'4'       ; amber font
    BNE  NOAMB
    LDA  #TEXT_COLOR_SET
    STA  PICO_R0
    LDA  #%00010000 ; dark red
    STA  PICO_R1
    LDA  #%00111000 ; amber
    STA  PICO_R1
    LBSR PARA2
    LBRA ENDS
NOAMB
    CMPA  #'5'       ; red font
    BNE  NOCR
    LDA  #TEXT_COLOR_SET
    STA  PICO_R0
    LDA  #%00010000 ; dark red
    STA  PICO_R1
    LDA  #%00110000 ; red
    STA  PICO_R1
    LBSR PARA2
    LBRA ENDS
NOCR
    CMPA  #'t'       ; Draw test pattern in area
    BNE  NOTP
    LDA  #$21
    STA  PICO_R0
    LBRA ENDS
NOTP    
    CMPA  #'q'       ; reprogram font glyphs
    BNE  NOQ
    LDA  #$20
    STA  PICO_R0
    LDA  #32         ; starting with glyph 32
    STA  PICO_R1     
    LDX  #STARTFONT  ; copy font bytes,
FONTLOOP
    LDA   ,X+
    EORA  #$ff       ; with all pixels inverted.
    STA   PICO_R1         
    CMPX  #ENDFONT
    BNE   FONTLOOP
    ;LDA  #4          ; set cursor color to black
    ;STA  PICO_R0
    ;LDA  #$00
    ;STA  PICO_R1

    LBRA  ENDS
NOQ
    CMPA #' '       ; reset font to default
    BNE  NOSP
    LDA  #$1F
    STA  PICO_R0
    ;LDA  #12
    ;STA  PICO_R1
    ;LDA  #4          ; set cursor color to white
    ;STA  PICO_R0
    ;LDA  #$FF
    ;STA  PICO_R1
    LBRA ENDS
NOSP
    CMPA  #'x'       ; set text area to subset of screen
    BNE  NOX
    LDA  #$17
    STA  PICO_R0
    LDA  #8
    STA  PICO_R1
    LDA  #4
    STA  PICO_R1
    LDA  #(80-16)
    STA  PICO_R1
    LDA  CUR_ROWS
    SUBA #8
    STA  PICO_R1
    LBRA ENDS    
NOX
    CMPA  #'e'       ; set text area to whole screen
    BNE  NOE
    LDA  #$17
    STA  PICO_R0
    LDA  #0
    STA  PICO_R1
    LDA  #0
    STA  PICO_R1
    LDA  #80
    STA  PICO_R1
    LDA  CUR_ROWS
    STA  PICO_R1
    LBRA ENDS    
NOE
    CMPA #'p'       ; print paragraph
    BNE  NO_P
    LBSR PRINTPARA
    LBRA ENDS
NO_P
    CMPA #'z'       ; print word
    BNE  NOZ
    LBSR PRINTWORD
    LBRA ENDS
NOZ
    CMPA #'v'       ; do 8x16 font art
    BNE  NOV
    LDA  #FONT_8X16_SEMIGRAPHICS
    LBSR SET_TEXTMODE
    LDX  #GLYPHART
    LBSR SHOW_GLYPHART
    LBRA ENDS
NOV    
    CMPA #'b'       ; do 8x8 font art
    BNE  NOB
    LDA  #FONT_8X8_SEMIGRAPHICS
    LBSR SET_TEXTMODE
    LDX  #GLYPHART2
    LBSR SHOW_GLYPHART
    LBRA ENDS
NOB    
    CMPA #'n'       ; do 8x4 font art
    BNE  NON
    LDA  #FONT_8X4_SEMIGRAPHICS
    LBSR SET_TEXTMODE    
    LDX  #GLYPHART3
    LBSR SHOW_GLYPHART
    LBRA ENDS    
NON    
    CMPA #'h'       ; do 8x1 font art
    BNE  ENDS
    LDA  #FONT_8X1_SEMIGRAPHICS
    LBSR SET_TEXTMODE    
    ;LDX  #GLYPHART4
    ;LBSR SHOW_GLYPHART
    LBRA ENDS    
ENDS    

    ;LDA  TMP8_0
    ;STA  PICO_R1    ; print a character glyph
    ;INCA            ; select next character glyph
    ;STA  TMP8_0

    JMP  TESTLOOP   ; Keep looping
ENDLOOP
    RTS

;------------------------------------------------------------------------------
MSG
    FCC  "This book contains the records left us by a man whom, according to"
    FCB  0
    FCC  "the expression he often used himself, we called the Steppenwolf."
    FCB  0
    FCC  "Whether this manuscript needs any introductory remarks may be open to"
    FCB  0
    FCC  "question. I, however, feel the need of adding a few pages to those of"
    FCB  0
    FCC  "the Steppenwolf in which I try to record my recollections of him. What"
    FCB  0
    FCC  "I know of him is little enough. Indeed, of his past life and origins"
    FCB  0
    FCC  "I know nothing at all. Yet the impression left by his personality has"
    FCB  0
    FCC  "remained, in spite of all, a deep and sympathetic one."
    FCB  0
    FCC  ""
    FCB  0
    FCC  "Some years ago the Steppenwolf, who was then approaching fifty, called"
    FCB  0
    FCC  "on my aunt to inquire for a furnished room. He took the attic room on"
    FCB  0
    FCC  "the top floor and the bedroom next it, returned a day or two later with"
    FCB  0
    FCC  "two trunks and a big case of books and stayed nine or ten months with"
    FCB  0
    FCC  "us. He lived by himself very quietly, and but for the fact that our"
    FCB  0
    FCC  "bedrooms were next door to each other--which occasioned a good many"
    FCB  0
    FCC  "chance encounters on the stairs and in the passage--we should have"
    FCB  0
    FCC  "remained practically unacquainted. For he was not a sociable man."
    FCB  0
    FCC  "Indeed, he was unsociable to a degree I had never before experienced"
    FCB  0
    FCC  "in anybody. He was, in fact, as he called himself, a real wolf of the"
    FCB  0
    FCC  "Steppes, a strange, wild, shy--very shy--being from another world"
    FCB  0
    FCC  "than mine. How deep the loneliness into which his life had drifted on"
    FCB  0
    FCC  "account of his disposition and destiny and how consciously he accepted"
    FCB  0
    FCC  "this loneliness as his destiny, I certainly did not know until I read"
    FCB  0
    FCC  "the records he left behind him. Yet, before that, from our occasional"
    FCB  0
    FCC  "talks and encounters, I became gradually acquainted with him, and I"
    FCB  0
    FCC  "found that the portrait in his records was in substantial agreement"
    FCB  0
    FCC  "with the paler and less complete one that our personal acquaintance had"
    FCB  0
    FCC  "given me."
    FCB  0
ENDMSG
